        if ($result.ReturnValue -ne 0) {
            Write-Warning "[-] Unable to obtain result for Import-Script command. WMI returnValue: $($result.returnValue)"
        }

        #Get the result
        $returnObject.ReturnCode = $result.uValue      
        $wmiArgs['Name'] = "GetStringValue"
        $wmiArgs['ArgumentList'] = $HKEY_LOCAL_MACHINE,$RegistryPath,$RunKey
        Write-Verbose "[+] Obtaining the result"
        $result = Invoke-WmiMethod @wmiArgs @commonArgs
        if ($result.ReturnValue -ne 0) {
            Write-Warning "[-] Unable to obtain output for the Import-Script command. WMI returnValue $($result.returnValue)"
